        [TestCase("Famous Portrait Artists", "ipfs://ipfs/bafybeig7rgfhxtjtzue5ee7h3kmr57lmlqlasceywxdkjcoaqwyfoufary/image.jpeg", @"{""name"":""John Singer Sargent #2017"",""description"":""John Singer Sargent (1856-1925) was an American painter who spent most of his career in Europe, where he became known for his portraits of the wealthy and famous. He was born in Florence, Italy, to American parents, and spent much of his childhood traveling between Europe and the United States.\n\n\nSargent studied art in Paris under the renowned portrait painter Carolus-Duran, who had a strong influence on his style. Sargent&#x27;s portraits are known for their bravura brushwork, rich color, and ability to capture the personality and character of his subjects.\n\n\nIn addition to portraits, Sargent also painted landscapes and genre scenes. He was a prolific artist, and his work can be found in many museums and private collections around the world.\n\n\nSome of Sargent&#x27;s most famous works include &quot;Madame X,&quot; a portrait of a society beauty in a scandalous black dress, and &quot;The Daughters of Edward Darley Boit,&quot; a group portrait of four young girls in a dimly lit hallway.\n\n\nSargent was highly regarded by his contemporaries and was honored with many awards and accolades throughout his career. Today, he is considered one of the greatest portrait painters of all time."",""external_url"":""https://sologenic.org/nfts/rwJZxW8NKqmz5qH8yeRVa2aHi4JUeLHf7t"",""attributes"":[],""category"":""art"",""md5hash"":""db45672c32b31302a1b8e195389696b8"",""is_explicit"":false,""content_type"":""image/jpeg"",""protected_content"":{""encryptedText"":""""},""image_url"":""ipfs://ipfs/bafybeig7rgfhxtjtzue5ee7h3kmr57lmlqlasceywxdkjcoaqwyfoufary/image.jpeg"",""animation_url"":""ipfs://ipfs/bafybeig7rgfhxtjtzue5ee7h3kmr57lmlqlasceywxdkjcoaqwyfoufary/animation.jpeg""}")]

